Corner $A$ of a rectangular piece of paper of width 8 inches is folded over so that it coincides with point $C$ on the opposite side. If $BC = 5$ inches, find the length in inches of fold $l$.

[asy]
size(100);

draw( (0,0) -- (8,0) -- (8, 10) -- (0, 10) -- cycle);
dot((8,10)); dot((0,6)); dot((3,10));
label("$A$", (8,10) , NE); label("$C$", (0,6), W); label("$B$", (3,10), N);
label(" $8''$ ", (0,0)--(8,0), S);

draw((0,0)--(8,0)); draw((0,0)--(0,6)); draw((0,10)--(3,10));
draw((8,0)--(3,10), 1pt+dashed);
draw((0,6)--(3,10)); draw((0,6)--(8,0));
label ("$l$", (6,6), SE);
[/asy]

Two $4\times 4$ squares intersect at right angles, bisecting their intersecting sides, as shown. The circle's diameter is the segment between the two points of intersection. What is the area of the shaded region created by removing the circle from the squares? [asy]
/* AMC8 2004 #25 Problem */
path square=((0,0)--(4,0)--(4,4)--(0,4)--cycle);
filldraw(shift(-sqrt(8)/2.0)*rotate(45)*square, lightgrey, black);
filldraw(shift(sqrt(8)/2,0)*rotate(45)*square, lightgrey, black);
filldraw(circle((0,sqrt(8)), sqrt(8)/2), white, black);
[/asy]

A rectangle with perimeter 176 is divided into five congruent rectangles as shown in the diagram.  What is the perimeter of one of the five congruent rectangles?

[asy]
unitsize(0.6 cm);

draw((0,0)--(6,0)--(6,5)--(0,5)--cycle);
draw((0,2)--(6,2));
draw((3,0)--(3,2));
draw((2,2)--(2,5));
draw((4,2)--(4,5));
[/asy]

Each triangle in this figure is an isosceles right triangle. The length of $\overline{BC}$ is 2 units. What is the number of units in the perimeter of quadrilateral $ABCD$? Express your answer in simplest radical form.

[asy]
draw((0,0)--(10,0)--(0,10)--cycle);
draw((10,0)--(0,10)--(10,20)--cycle);
draw((1,0)--(1,1)--(0,1));
draw((1,11)--(2,10)--(1,9));
label("$A$",(0,0),S);
label("$B$",(10,0),S);
label("$C$",(10,20),N);
label("$D$",(0,10),W);

[/asy]

Squares $ABCD$ and $EFGH$ are equal in area.  Vertices $B$, $E$, $C$, and $H$ lie on the same line.  Diagonal $AC$ is extended to $J$, the midpoint of $GH$.  What is the fraction of the two squares that is shaded? [asy]
fill((0,4)--(4,4)--(4,0)--cycle,gray);
fill((4,0)--(6,0)--(6,-2)--cycle,gray);
draw((0,0)--(4,0)--(4,4)--(0,4)--cycle,linewidth(1));
draw((2,0)--(6,0)--(6,-4)--(2,-4)--cycle,linewidth(1));
draw((0,4)--(6,-2),linewidth(1));
label("$A$",(0,4),NW);
label("$B$",(0,0),W);
label("$C$",(4,0),NE);
label("$D$",(4,4),NE);
label("$E$",(2,0),SW);
label("$F$",(2,-4),SW);
label("$G$",(6,-4),SE);
label("$H$",(6,0),E);
label("$J$",(6,-2),E);
[/asy]

A square is divided, as shown. What fraction of the area of the square is shaded? Express your answer as a fraction. [asy]
