$ABCD$ is a square with $AB = 8$cm. Arcs $BC$ and $CD$ are semicircles. Express the area of the shaded region, in square centimeters, and in terms of $\pi$. (As always, do not include units in your submitted answer.) [asy]
real y = .866025404;
draw((-1,-1)--(1, -1) -- (1, 1) -- (-1, 1)--cycle );
draw( Arc( (1,0), 1, 90, 270));
draw( Arc( (0,1), 1, 180, 360));
fill((0,0)..(.5, y).. (1,1) --cycle, gray(0.7)); fill((0,0)..(y, .5).. (1,1) --cycle, gray(0.7));
label ("$A$", (-1,-1) , SW); label ("$B$", (1,-1) , SE); label ("$C$", (1,1) , NE); label ("$D$", (-1,1) , NW);

[/asy]

The grid below contains the $16$ points whose $x$- and $y$-coordinates are in the set $\{0,1,2,3\}$: [asy]
size(2.5cm);
for(int i=0; i<4; i+=1) { for(int j=0; j<4; j+=1) { dot((i,j)); }; };
[/asy] A square with all four of its vertices among these $16$ points has area $A$. What is the sum of all possible values of $A$?

Circles with centers at $O$ and $P$ have radii 2 and 4, respectively, and are externally tangent. Points $A$ and $B$ on the circle with center $O$ and points  $C$ and $D$ on the circle with center $P$ are such that  $\overline{AD}$ and $\overline{BC}$ are common external tangents to the circles. What is the area of the concave hexagon $AOBCPD$?

[asy]
pair A,B,C,D,H,O,P;
O = (0,0);
P = (6,0);
H = (-6,0);
A = intersectionpoint(arc((A + H)/2, abs(A -  H)/2, 0, 180), arc(O, 2, 0, 180));
D = intersectionpoint(arc((A + P)/2, abs(A -  P)/2, 0, 180), arc(P, 4, 0, 180));
B = reflect(O,P)*(A);
C = reflect(O,P)*(D);
draw(O--P,linewidth(0.7));
draw(Circle(O,2),linewidth(0.7));
draw(Circle(P,4),linewidth(0.7));
draw(interp(A,D,-0.2)--interp(A,D,1.2),linewidth(0.7));
draw(interp(B,C,-0.2)--interp(B,C,1.2),linewidth(0.7));
draw(A--O--B,linewidth(0.7));
draw(D--P--C,linewidth(0.7));
label("$O$",O,SE);
label("$P$",P,E);
label("$D$",D,NW);
label("$A$",A,NW);
label("$B$",B,S);
label("$C$",C,S);
label("2",(-0.45,0.95),E);
label("6",(3,0),N);
label("4",(5.55,1.95),E);

[/asy]

In isosceles triangle $ABC$, if $BC$ is extended to a point $X$ such that $AC = CX$, what is the number of degrees in the measure of angle $AXC$? [asy] size(220);
pair B, A = B + dir(40), C = A + dir(-40), X = C + dir(0);
draw(C--A--B--X--A); draw(A/2+.1*dir(-30)--A/2-.1*dir(-30));
draw((A+C)/2+.1*dir(30)--(A+C)/2-.1*dir(30));
label("A",A,N); label("C",C,S); label("B",B,S); label("X",X,S); label("$30^{\circ}$",B+.1*dir(0),NE);
draw(arc(B,1/3,0,40));
[/asy]

Four circles of radius 1 are each tangent to two sides of a square and externally tangent to a circle of radius 2, as shown.  What is the area of the square?

[asy]
unitsize(1cm);draw(Circle((0,0),2));
for(int i=0; i<4; ++i) {
	draw(Circle(scale(3)*dir(45+90*i),1));
	draw((3+sqrt(2))*dir(45+90*i)--(3+sqrt(2))*dir(-45+90*i));  
}
draw((0,0)--(2,0));
label("2",(1,0),N);
draw(scale(3)*dir(45+90*1)--shift((1,0))*scale(3)*dir(45+90*1));
label("1",point(scale(3)*dir(45+90*1)--shift((1,0))*scale(3)*dir(45+90*1),.5),S);
[/asy]

The graph of the rational function $\frac{p(x)}{q(x)}$ is shown below, with a horizontal asymptote at $y = 0$. If $q(x)$ is quadratic, $p(2)=2$, and $q(-1) = 18$, find $p(x) + q(x).$
[asy]
size(8cm);
import graph;

Label f; 
f.p=fontsize(6); 

real f(real x) {return 2*(x-1)/(3*(x-2)*(x-1));}

int gridsize = 5;
draw((-gridsize,0)--(gridsize,0), black+1bp, Arrows(8));
draw((0,-gridsize)--(0, gridsize), black+1bp, Arrows(8));
label("$x$", (gridsize, 0), E);
label("$y$", (0, gridsize), N);
label("$0$", (0,0),SE, p=fontsize(8pt));
for (int i=-gridsize+1; i<0; ++i){
    label("$"+string(i)+"$",(i,0),S, p=fontsize(8pt));
    label("$"+string(i)+"$",(0,i),E, p=fontsize(8pt));}
for (int i=1; i<=gridsize-1; ++i){
    label("$"+string(i)+"$",(i,0),S, p=fontsize(8pt));
    label("$"+string(i)+"$",(0,i),E, p=fontsize(8pt));}



draw(graph(f,-5,.85));
draw(graph(f,1.15,1.85));
draw(graph(f,2.15,5));
draw((2,-5)--(2,5), dashed);
draw(circle((1,-2/3),.15));

[/asy]

